import React from 'react';
import TeamColors from './TeamColors'
export default function TeamHeader({ teamId, teamName, season }){
  const backgroundColor = TeamColors["%s" % teamId]["colors"]["hex"][0];

  const style = {
    "backgroundColor":backgroundColor,
    "color":"white"
  }
  return(
    <header style={style}>
      <h1>{teamName}</h1>
      <h1>{season}</h1>
    </header>
  );
}
